import React from "react";

const courses = [
  {
    _id:'123',
    title: 'CS4550'
  },
  {
    _id:'345',
    title: 'CS5610'
  },
  {
    _id:'456',
    title: 'CS3200'
  }
]
const CourseListComponent = () =>
    <div className={"container"}>
      <h1>Course List</h1>
      <table className={"table"}>
        <thead>
        <tr>
          <th>
            Title
          </th>
        </tr>
        <tbody>

        {
          courses.map(course =>
              // row in first assignment
              <tr>
                <td>{course.title}</td>
              </tr>
          )
        }
        </tbody>
        </thead>
      </table>
    </div>

export default CourseListComponent
